// main.js

import Vue from 'vue';
import App from './App.vue';
import axios from 'axios';

Vue.config.productionTip = false;

// Defina a URL base do servidor
axios.defaults.baseURL = 'http://localhost:3000'; // Esta deve ser a URL do seu servidor Node.js

new Vue({
  render: (h) => h(App),
}).$mount('#app');
